import Select from "react-select";
import { useFilterPosts } from "../../utilities/hooks/useFilterPosts";

export function SelectForFilteredByName() {
  const { userOptions, setSelectedUsers } = useFilterPosts();

  return (
    <Select
      className="w-25"
      isMulti
      options={userOptions}
      onChange={setSelectedUsers}
    />
  );
}
